import React from 'react';
import { ParallaxProvider, Parallax } from 'react-scroll-parallax';
// import { styles } from 'ansi-colors';



const Footer = () => {
  return(
    <div className='footer' style={styles.footer}>
      <div className='footer_container' style={{width:'50%', height:'50%', backgroundColor:'blue'}} >
        <Parallax style={styles.paragraph} className="custom-class" x={['-20px', '300px']} y={['-30px', '300px']} >
          <div >this is footer section now</div>
        </Parallax>
      </div>
    </div>
  );
}

export default Footer;


const styles={
  paragraph: {
    position: 'relative',
    backgroundColor: 'red',
    width:'300px'
  },
  footer: {
    width:'100%',
    position:'relative',
    height:'100vh',
    backgroundColor:'lightgreen'
  }
}
